import React from "react";

const baseURL = 'https://strangers-things.herokuapp.com/api/2206-ftb-et-web-ft-b'


const Post = () => {
  const fetchPosts = async () => {
    try {
      const response = await fetch(`${baseURL}/posts`);
      const results = await response.json();
      console.log(results);
    } catch (err) {
      console.error(err);
    }
  };

  return(
    <div>{results}</div>
  )
};

export default Post;
